sEverydaySoapMaking"}},"channelThumbnail":{"thumbnails":[{"url":"https://yt3.ggpht.com/ytc/AIdro_nSHJR1fBlhxGjgOkq2CiwJIf-aD11ZjUx4681TRtLAw8c=s88-c-k-c0x00ffffff-no-rj"}]}}},{"expandableVideoDescriptionBodyRenderer":{"showMoreText":{"simpleText":"Show more"},"showLessText":{"simpleText":"Show less"},"attributedDescriptionBodyText":{"content":"I made this video back in 2016, to help newcomers to sourdough breadmaking. This is an easy, straightforward sourdough bread recipe and method that is great for working into a busy midweek schedule, and requires very little preparation or clean up. You don't even need to get your hands floury! (unless you want to of course). I make many kinds of sourdough breads (and these days mostly 100% whole grain sourdough loaves) but this was the easy method I used for many years, especially when I was busy and needed to get my bread made! \n\nRecipe details\nA new, updated (2021) version of this recipe (including new video!) is posted here:\nhttps://www.ellyseveryday.com/ellys-e...\n\n*I bake this loaf in a ceramic casserole pot, roaster, dutch oven or bread pan inside a large roaster. As long as your baking vessel has a well-fitting lid and is oven safe – you can use it! Check out this video for some good alternative baking setup options    • Home Bread Baking Setup Options - Mak...  \n\n• 2 cups plain/all purpose/bread flour \n• 1 cup whole wheat flour \n• ½ to 1 cup starter (mine is a plain wheat starter)\n• About 1 and 1/4 cups of water \n• 1 ½ teaspoons sea salt \n• I also often add a few tablespoons of seeds of various descriptions: LSA (linseed/flax, sunflower and almond meal), sesame seeds, pepitas, walnuts or ground flax etc for more nutrition and interest.\n\nMETHOD as per video demonstration\n\nMockmill information and discount links: https://www.ellyseveryday.com/mockmill\n\nTo buy me a coffee \nhttps://www.buymeacoffee.com/ellyseve...\n♡ Thank you for your support ♡\n\nWebsite https://www.ellyseveryday.com/\nNewsletter http
